"use strict";

function f_gold(s) {
    let words = s.split(' ');
    let arr = new Array(words.length);
    for (let word of words) {
        let idx = parseInt(word[word.length - 1]) - 1;
        arr[idx] = word.slice(0, -1);
    }
    return arr.join(' ');
}
